@dev Retrieve the balance of a specific token in this Cluster
@param token The ERC20 token whose balance needs to be fetched
@return The balance of the specified token within this Cluster

@dev Deposit a given amount of a specific token into the Cluster
@param token The ERC20 token to deposit
@param amount The amount of tokens to deposit

@dev Withdraw a given amount of a specific token to a destination address
@param token The ERC20 token to withdraw
@param to The recipient address
@param amount The amount of tokens to withdraw
@notice Can only be called by the Cluster's admin

@dev Cast a vote on a governance proposal
@param governor The governance contract handling the proposal
@param proposalId The ID of the proposal to vote on
@param support The type of support (e.g., for, against)

@dev Propose a new governance action
@param governor The governance contract where the proposal is made
@param targets Array of target addresses for the proposal actions
@param values Array of values for the proposal actions
@param calldatas Array of calldata for the proposal actions
@param description A text description of the proposal
@return The ID of the new proposal

@title ICluster Interface
@dev Specifies the interface that the Cluster contract should adhere to
@notice Clusters serve as containers for tokens and are managed by an admin
